import axios from "axios";
import ls from 'local-storage';
import { Eject } from "@material-ui/icons";

const url = "http://localhost:4000"

export const userFetchLocal = () => {
    return ls.get('user');
}

export const signupApi = (email,password) =>{
    console.log("Signup Api")
    const apiString = url+"/api/user/unauth/create"
    axios.post(apiString,{
        email,
        password
    })
    .then(({
        data
    }) => {
        console.log(data)
    }).catch(err => {
        console.log(err)
    });
}

export const signupGoogleApi = (profile,token) =>{    
    console.log("Signup Api")
    const apiString = url+"/api/user/unauth/create"    
    return new Promise((resolve, reject) => {
        axios.post(apiString,{
            email:profile.getEmail(),
            givenName: profile.getGivenName(),
            familyName: profile.getFamilyName(),
            googleImageUrl:profile.getImageUrl(),
            googToken:token
        }).then(({ user }) => {
            console.log(user)
            resolve(user)
        }).catch(err => {
            reject(err)
        });        
    }) 

}
